import logo from '../../images/logo.png';
import React from 'react';
import {Nav, NavLink, Bars, NavBtn, NavBtnLink, NavMenu} from './Navbar.js';
import Sidebar from './Sidebar.js';
import './Navbar.css';

const expand = () => {
    let sidebar = document.getElementById("menu");
    let nav = document.querySelector("div#root>nav");
    let root = document.getElementById('root');
    if (sidebar.style.visibility === 'hidden') {
        sidebar.style.visibility = 'visible';
        root.insertBefore(sidebar, document.querySelector(".page-container"));
    } else {
        sidebar.style.visibility = 'hidden';
        nav.insertBefore(sidebar, document.querySelector('svg[stroke]'));
    }
    
}

let observer = new MutationObserver(function(mutations) {
    console.log('mutations:', mutations);
   // console.log(window.screen.width);
  });

  let child = document.querySelector('#menu');
  observer.observe(child, { attributes: true });

const style = {
    position: 'relative'
}
const Navbar = () => {

    return (
        <>
            <Nav>
                <NavLink to="/">
                    <img src={logo} alt='veriboy logo' className="logo"></img>
                </NavLink>
                <Bars onClick={expand}></Bars>
                <Sidebar />
                <NavMenu>
                    <NavLink to="/about" activeStyle>
                        About
                    </NavLink>
                    <NavLink to="/votes" activeStyle>
                        Votes
                    </NavLink>
                    <NavLink to="/News" activeStyle>
                        News
                    </NavLink>
                    <NavLink to="/sign-in" activeStyle>
                        Sign in
                    </NavLink>
                </NavMenu>
                <NavBtn>
                    <NavBtnLink to="/profile">
                        Profile
                    </NavBtnLink>
                </NavBtn>
            </Nav>
        </>
    )
}

export default Navbar;
